import Slider from './Slider'

const Header = (props) => {
  return (
    <nav className='navbox'>
        <div className='info'>
            <div className='mini-box'></div>
            <span>RGB()</span>

        </div>

        <div className='slider'>
            <Slider slide={props.slide}
                    handle  />
        </div>
    </nav>

  )
}

export default Header
